import { addCommaInData } from '../data-utility'
export const columnPartnerList = (handleSearch, handleReset) => {
  return [
    {
      title: 'No.',
      dataIndex: 'no',
    },
    {
      title: 'Channel',
      dataIndex: 'channel',
    },
    {
      title: 'Txn Limit',
      dataIndex: 'txn_limit',
    },
    {
      title: 'Daily Limit',
      dataIndex: 'daily_limit',
      render: (text, record) => addCommaInData(text, true)
    },
    {
      title: 'Action',
      dataIndex: 'operation',
    },
  ];
}
